import React from "react";

const TopAnime = () => {
  return (
    <div className="text-white bg-gray-700 p-2">
      <div>
        <div className="topanime-title text-2xl font-semibold mb-3">
          Top Anime
        </div>
        <div class=" relative h-44 w-full mb-3">
          <img
            src="/assets/images/hxh.webp"
            alt=""
            className="object-cover absolute top-0 left-0 w-full h-full"
          />
        </div>
        <div className="topanime-others">
         <div className="ranking">1</div>
        </div>
      </div>
    </div>
  );
};

export default TopAnime;
